var StepSIZE=0.2/32.0;          //格子的大小
var VISCOSITY=0.5;
var STIFF=1.5;
var started = false;
var length = 0;
var my_sphere = new Array(0);
var state = new Array(32*32*32);
var posX = new Array(8000);         //粒子初始位置
var num;                             //粒子个数

var object = new Body();

var run = true;
var changeMode = false;
var posData = new Array(0);
var tempData = posX;
// Rendering

var render= function()
{
    object.findNeighbous();
    object.computeDensity();
    //根据密度场提取等值面并绘制等值面
    object.createImplicitIso();

    
    if(!changeMode)
    {
        if(started)
        {
            for (i = 0; i< num; i++)
            {
                my_sphere[i].position.y = object.posCur[i].y;
                my_sphere[i].position.x = object.posCur[i].x;
                my_sphere[i].position.z = object.posCur[i].z;
            }

        }
        if(!started) {
            for (i = 0; i < num; i++) {
                geometry = new THREE.SphereGeometry(0.002, 10, 10);
                material = new THREE.MeshLambertMaterial({color: 0xffffff * 0.5});
                my_sphere.push(new THREE.Mesh(geometry, material));
                my_sphere[i].position.y = object.posCur[i].y;
                my_sphere[i].position.x = object.posCur[i].x;
                my_sphere[i].position.z = object.posCur[i].z;
                scene.add(my_sphere[i]);
            }
            started = true;
        }
    }
    if(changeMode)
    {
        for (i = 0; i< num; i++)
        {
            scene.remove(my_sphere[i]);
        }
        started = false;
        object.renderIsoSurface(scene);
    }

    if (run)
    {
        object.computeForce();
        object.collisionProcess();       //估计下时刻位置进行碰撞检测
        object.update();
    }
    renderer.render(scene,camera);
    requestAnimationFrame(render);
};
function initInput() {
    window.addEventListener( 'keydown', function( event ) {
        if(event.keyCode === 49) {
            //alert("1");
            object.initialize(num,VISCOSITY,STIFF,2.0*StepSIZE, posX);
        }
    }, false );

    window.addEventListener( 'keydown', function( event ) {
        if(event.keyCode === 50) {
            //alert("2");
            run=!run;
        }
    }, false );

    window.addEventListener( 'keydown', function( event ) {
        if(event.keyCode === 51) {
            //alert("3");
            changeMode=!changeMode;
        }
    }, false );
}

var renderer;
function initThree() {
    width = document.getElementById('canvas-frame').clientWidth;
    height = document.getElementById('canvas-frame').clientHeight;
    renderer = new THREE.WebGLRenderer({
        antialias : true
    });
    renderer.setSize(width, height);
    document.getElementById('canvas-frame').appendChild(renderer.domElement);
    renderer.setClearColor(0x555555, 0.5);
}

var camera;
function initCamera() {
    camera = new THREE.PerspectiveCamera(90, width / height, 0.001, 5000.0);
    camera.position.x = 0.2;
    camera.position.y = 0.2;
    camera.position.z = 0.2;
    camera.up.x = 0;
    camera.up.y = 1;
    camera.up.z = 0;
    camera.lookAt({
        x : 0,
        y : 0.1,
        z : 0.2
    });
}

var scene;
function initScene() {
    scene = new THREE.Scene();
}

var light;
function initLight() {
    // A start
    light = new THREE.PointLight(0xFFFFFF);
    light.position.set(0.8, 0.8, 0.8);
    scene.add(light);
    // A end
}

